            </div>
          </div>
          <div className="">
           <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRs81atcQXAd-qGTGWlD30J269gv6EhYM6huycUPcpbs0hYtFDv_7dkGIIVWISOONQbMP4&usqp=CAU" className="w-60 h-32" alt="" />

          </div>
        </div>
      </div>
    </MainLayout>
  );
}

export default HomePage;
